import React, { Component } from "react";

import {
  Container,
  Navbar,
  NavbarBrand,
  Row,
  Col,
  Nav,
  NavItem,
  NavLink
} from "reactstrap";
import Main from "./main";
class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Container fluid>
          <Navbar dark color="dark">
            <NavbarBrand href="/">My React App</NavbarBrand>
          </Navbar>
          <Row>
            <Col xs="2">
              <Navbar>
                <Nav>
                  <NavItem>
                    <NavLink href="#">Link</NavLink>
                  </NavItem>
                  <NavItem>
                    <NavLink href="#">Link</NavLink>
                  </NavItem>
                  <NavItem>
                    <NavLink href="#">Link</NavLink>
                  </NavItem>
                </Nav>
              </Navbar>
            </Col>
            <Col xs="8">
              <Main></Main>
            </Col>
            <Col xs="2">
              <Navbar>dddd</Navbar>
            </Col>
          </Row>
        </Container>
      </React.Fragment>
    );
  }
}

// function App() {
